insert  into `berita_acara`(`id`,`tgl`,`jam`,`judul`,`isi`,`id_karyawan`,`hapus`) values (1,'2015-11-23','11:25:43','TRANSAKSI EDC','Selamt pagi pak,\n\nInformasi 23/11/15 jam 08.30-10.00 WIB daerah simongan mengalami pemadaman listrik. Sehingga mesin EDC secara otomatis\nmati sehingga transaksi pada jam tersebut terhambat dan belum melakukan pembayaran secara EDC. pangkalan yang belum melakukan pembayaran \\\" PAK SAPARIN\\\" dengan transaksi 100 tabung 3KG (Rp 1.425.000,-) dan 10 tabung 12 KG (Rp. 1.328.000,) sehingga pangkalan tersebut melakukan pembayaran besok (24-11-15).\n\nberikut informasi yang saya sampaikan, terima kasih.',5,'0'),(2,'2015-11-27','08:05:36','Hapus double entry kas kecil','Selamat pagi pak,.\n\nMohon dihapuskan ID KKS1511260011 untuk solar H 1757 WH pri tanggal 26 november 2015 karena double entry.\n\nTerima kasih sebelumnya.',9,'1'),(3,'2015-11-27','09:52:17','DOUBLE ENTRY','Selamat pagi pak.\n\npada tgl 26 nov kemarin saya salah double entry energas transaksi pak saparin salah tanggal 25 nov yang seharusnya tgl  26 nov dengan id EGN15112517. \nmohon transaksi tgl 25 nov dengan id tersebut dihapus.\n\nterima kasih,',5,'0'),(4,'2015-11-27','14:20:35','Hapus data','selamat siang pak,.\n\nMohon dihapuskan data dikas kecil ID KKE1511270006, terima dari bank sejumlah Rp. 3.000.000,- karena salah masuk, seharusny masuk di kas masuk.\n\nterima kasih sebelumnya.',9,'1'),(5,'2015-11-28','13:28:33','Mohon hapus data','selamat siang pak...\n\nMohon dihapuskan ID KKE 1511280001 UM 23/27 nov 15, 225.000.\n\nterimakasih sebelumny.',9,'0'),(6,'2015-11-30','09:04:54','hapus data','Selamat pagi pak..\n\nmohon dihapuskan ID KKS 1511280003 solar Hendro tgl 28/11/15.\n\nmakasih sebelumnya...',9,'0'),(7,'2015-12-01','16:59:22','double entry','selamat sore pak.\nmohon dihapuskan id sgj15111612 tgl transaksi tg 16/11/15 no nota 30246\ndan id sgj15120115 tanggal 01/12/15 no nota 030810 karena bouble entry. terima kasih',5,'0'),(8,'2015-12-04','10:05:20','doubel entry','Selamat pagi pak..\n\nMohon dihapuskan ID KKE 151202000 , sola samidi 369.907.  karena double entry.\n\nterima kasih sebelumnya.',9,'0'),(9,'2015-12-05','10:24:16','kesalahan tggal 2-12-2015','selamat pagi pak. maaf pak mau menginfokan untuk kesalahan input tanggal 2/12 untuk traansaksi bu evi no ID EGN1520206  untuk dihapus yang betul itu untuk transaksi pak budi. dan untuk kekurangan pak jono sudah saya input tadi pagi pak ( 05/12/2015) .terima kasih.',5,'0'),(10,'2015-12-05','10:29:12','kesalahan untuk tgl 3/12/15','selamat pagi pak. mohon untuk dihapus transaksi EGN15120310 NO NOTA 043294 untuk transaksi pak djoelianto terjadi kesalalahan seharusnya sejumlah 80 tabung tetapi saya input 100 tabung. terima kasih.',5,'0'),(11,'2015-12-05','10:41:44','Salah Input transaksi','selamat siang pak\n\nmohon dihapuskan ID KKS 1512050001 ongkos angkut harjito, dan ID KKS 1512050002 ongkos angkut samidi seharusny masuk ke kas keluar energas tetapi salah masuk ke kas keluar gasindo.\n\n\nterima kasih sebelumnya.',9,'0'),(12,'2015-12-15','12:01:32','salah input dan bouble input','selamat pagi pak. mohon dihapuskan nota 030975 dengan no ID SGJ 15121427 VIRGIN TLOGOSARI Dan untuk energas untuk transaksi pak djoelianto 90 seharusnya 100 karena 90 tabung kosong pak djoelianto dan yang 10 tabung itu pinjam tapi saya sudah terlanjut ransaksi masuk kesistem 90 tabung. yang sehrusnya 100 tabung. dan juga 10 tabung pak djoelianto transfer jam setengah 5  sehingga saya tidak bisa entry karena saya belum tau bukti transfernya pak. terima kasih.',5,'0'),(13,'2015-12-26','15:41:06','pesanan mendadak','maaf pak michael tolong hapuskan nota \\\"031110\\\" ID SGJ15122603  untuk virgin ungaran  (19 tabung untuk 50kg)\ndikarenakan ada pesanan mendadak dan stock digudang untuk 50kg habis sehingga pesanan dari virgin ungaran terpaksa kami kurangi menjadi 15 tabung..',5,'0'),(14,'2015-12-29','17:17:31','penjualan pak andi','mohon maaf pak michael saya belum bisa input transaksi pak andi pudak payung untuk hari ini tgl 29/12/2015 sejumlah 200 tabung dikarenakan nomor bukti transfer belum ada terima kasih',5,'0'),(15,'2016-01-05','13:49:16','salah harga','selamat siang pak michael.tolong dihapuskan penjualan tggl 04-12-15 no nota 031240 atas nama pemancingan semarang island. dikarenakan sales salah memberikan harga seharusnya harga  Rp 130.000,-tetapi dikasih harga Rp. 135.000,-sehingga pihak coustemer minta nota baru. terima kasih.',5,'0'),(16,'2016-01-11','16:07:59','BELUM INPUT PENJUALAN PAK HOOK SENG','selamat sore pak. maaf pak saya belum bisa input penjualan pak djoelianto karena belum ada alokasinya ,terima kasih. (11/01/2016)',5,'0'),(17,'2016-01-12','15:47:09','PENJUALAN PAK ANDI PUDAK PAYUNG','SELAMAT SORE PAK. HARI INI (12/01/2015)  SAYA BELUM BISA INPUT PENJUALAN PAK ANDI KARENA BELUM ADA BUKTI TRANSFER/DEBET. \nTERIMA KASIH.',5,'0'),(18,'2016-01-21','14:50:41','BELUM INPUT PENJUALAN PAK JATI','SELAMAT SORE PAK, MAAF PAK UNTUK TARANSAKSI HARI INI PAK JATI 73 TABUNG BELUM BISA SAYA INPUT KARENA ALOKASI BELUM ADA. TERIMA KASIH. (21/01/2016)',5,'0'),(19,'2016-02-09','16:38:37','double input','selamt sore pak. minta tolong pak untuk dihapuskan transaksi nota 031914 id AHS156020306 NON DO  penjualan marry acne nota tersebut masuk dua kali dengan nota yang sama. maaf pak sekaligus mau mengingatkan untuk penjualan 14/12/15 id transaksi sgj15121427 penjualan virgin tlogosari belum dihapus.terima kasih.',5,'0'),(20,'2016-02-12','08:51:45','INFORMASI ENTRY INPUT','SELAMAT PAGI, MAU MENGINFOKAN BAHWA TANGGAL 11/2/16 KEMARIN TERJADI PEMADAMAN LISTRIK DARI JAM 09.00 SAMPAI JAM 17.00 WIB SEHINGGA SEMUA TRANSAKSI YANG TERJADI DITANGGAL TERSEBUT BELUM TERINPUT DIKARENAKAN TERANSAKSI PEMBAYRAN JUGA TERHAMBAT. TERIMA KASIH .',5,'1'),(21,'2016-02-12','10:02:21','pemadaman listrik','pagi pak, mau menginfokan pada tgl 11-2-16 tidak bisa melakukan entry Kas EN & SGJ dikarenakan terjadi pemadaman listrik dari pukul 9.30 sampai 17.00.\nsehingga transaksi tgl 11-2-16 diinput pada tgl 12-2-16.',9,'1');

/*Table structure for table `karyawan` */

DROP TABLE IF EXISTS `karyawan`;

CREATE TABLE `karyawan` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nama` varchar(50) DEFAULT NULL,
  `id_level` int(11) DEFAULT NULL,
  `jk` varchar(1) DEFAULT NULL,
  `hapus` varchar(1) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=latin1;

