/*Table structure for table `kas_bank` */

DROP TABLE IF EXISTS `kas_bank`;

CREATE TABLE `kas_bank` (
  `id` varchar(13) NOT NULL,
  `id_bank` int(11) DEFAULT NULL,
  `no_bukti` text,
  `tgl` date DEFAULT NULL,
