  `tgl` date DEFAULT NULL,
  `id_konsumen` int(11) DEFAULT NULL,
  `id_barang` int(11) DEFAULT NULL,
  `jml` double DEFAULT NULL,
  `harga_jual` double DEFAULT NULL,
  `het` double DEFAULT NULL,
