  `id_bank` int(11) DEFAULT NULL,
  `no_bukti` text,
  `id_sales` int(11) DEFAULT NULL,
  `id_karyawan` int(11) DEFAULT NULL,
  `no_nota` varchar(7) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

